import React from "react";
import { Link, NavLink } from "react-router-dom";
import Panel from "./Panel";

const Navbar = () => {
  const baseClass = "border l-4 rounded-full text-white border-black  px-8 py-2";
  const activeClass =
    "bg-white border l-4 rounded-full text-white border-blue-500 font-bold px-8 py-2";
  return (
    <Panel className="sticky top-0 flex justify-center item-start">
      <NavLink
        to="/"
        className={({ isActive }) => (isActive ? activeClass : baseClass)}
      >
        Home
      </NavLink>

      <NavLink
        to="/accordion"
        className={({ isActive }) => (isActive ? activeClass : baseClass)}
      >
        About Me
      </NavLink>

      <NavLink
        to="/dropdown"
        className={({ isActive }) => (isActive ? activeClass : baseClass)}
      >
        Projects
      </NavLink>
    </Panel>
  );
};

export default Navbar;
